(function()
local _b = ""
local _k = 52
local _chars = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/'
local function _b64decode(data)
  data = data:gsub('[^'.._chars..'=]', '')
  local bin = (data:gsub('.', function(x)
    if x == '=' then return '' end
    local r = ''
    local f = _chars:find(x) - 1
    for i=6,1,-1 do
      r = r .. ( (f % (2^i) - f % (2^(i-1)) > 0) and '1' or '0' )
    end
    return r
  end))
  return (bin:gsub('%d%d%d%d%d%d%d%d', function(bin) return string.char(tonumber(bin,2)) end))
end

local decoded = _b64decode(_b)
local plain = decoded:gsub('.', function(c) return string.char((string.byte(c)-_k) % 256) end)
local fn, err = loadstring(plain)
if not fn then error('loadstring failed: '..tostring(err)) end
return fn()
end)()